PARÁGRAFO DÉCIMO QUINTO - NO ÚLTIMO ANO DE PRORROGAÇÃO, A CONTRATADA, PARA FAZER JUS À REAJUSTE OU REPACTUAÇÃO DO CONTRATO DEVERÁ SOLICITÁ-LO DENTRO DA VIGÊNCIA DO CONTRATO.
